    if not original or not another:
        return False
    original_parts = original.split()
    another_parts = another.split()
    original_set = set(original_parts)

    # Check if another is an exact match
    if another == original:
        return True

    # Check if another is any combination of parts from original
    for i in range(len(another_parts)):
        if another_parts[i] in original_set:
            # Check if remaining parts can be matched
            remaining_parts = another_parts[:i] + another_parts[i+1:]
            if all(part in original_set for part in remaining_parts):
                return True

    return False
