            return True
        if len(another_parts) <= len(original_parts):
            for j in range(len(original_parts) - len(another_parts) + 1):
                if another_parts == original_parts[j:j + len(another_parts)]:
                    return True

    # Check if the parts of the original can be rearranged to match another
    from itertools import permutations
    for perm in permutations(original_parts):
        if list(another_parts) == list(perm[:len(another_parts)]):
            return True

    return False
